{"title":"processing process exec times (box-plots)","type":"vega","aggs":[],"params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v3.json
  data: [
    {
      name: results
      url: {
        index: logstash-*
        body: {
          size: 0
          query: {
            bool: {
              must: [
                "%dashboard_context-must_clause%"
                {
                  range: {
                    @timestamp: {%timefilter%: true}
                  }
                }
                {
                  match: {
                    event: "process executed on worker"
                  }
                }
              ]
              must_not: ["%dashboard_context-must_not_clause%"]
              filter: [
                "%dashboard_context-filter_clause%"
              ]
            }
          }
          aggs: {
            exec_time_per_step: {
              terms: {field: "nomad.processing.process.keyword"}
              aggs: {
                quantile: {
                  percentiles: {
                    field: nomad.processing.exec_time
                    percents: [25, 50, 75]
                  }
                }
                min_value: {
                  min: {field: "nomad.processing.exec_time"}
                }
                max_value: {
                  max: {field: "nomad.processing.exec_time"}
                }
                avg_value: {
                  avg: {field: "nomad.processing.exec_time"}
                }
                max_value_sort: {
                  bucket_sort: {
                    sort: [
                      {
                        max_value: {order: "desc"}
                      }
                    ]
                    size: 20
                  }
                }
              }
            }
          }
        }
      }
      format: {property: "aggregations.exec_time_per_step.buckets"}
      transform: [
        {type: "formula", expr: "datum.quantile.values['25.0']", as: "q1"}
        {type: "formula", expr: "datum.quantile.values['50.0']", as: "median"}
        {type: "formula", expr: "datum.quantile.values['75.0']", as: "q3"}
        {type: "formula", expr: "datum.min_value.value", as: "min_value"}
        {type: "formula", expr: "datum.max_value.value", as: "max_value"}
        {type: "formula", expr: "datum.avg_value.value", as: "avg_value"}
        {type: "formula", expr: "datum.key", as: "step"}
        {
          type: fold
          fields: ["min_value", "q1", "median", "q3", "max_value", "avg_value"]
          as: ["metric", "metricValue"]
        }
      ]
    }
  ]
  scales: [
    {
      name: layout
      type: band
      range: height
      domain: {data: "results", field: "key"}
    }
    {
      name: xscale
      type: log
      range: width
      round: true
      domain: {data: "results", field: "metricValue"}
      zero: false
      nice: true
    }
    {name: "color", type: "ordinal", range: "category"}
  ]
  axes: [
    {
      orient: bottom
      scale: xscale
      zindex: 1
      format: s
      title: Exec time in s
    }
    {orient: "left", scale: "layout", tickCount: 20, zindex: 1}
  ]
  marks: [
    {
      type: group
      from: {
        facet: {data: "results", name: "meters", groupby: "key"}
      }
      encode: {
        enter: {
          yc: {scale: "layout", field: "key", band: 0.5} // "height": {"signal": "plotWidth"},
          // "width": {"signal": "width"}
        }
      }
      data: [
        {
          name: summary
          source: meters
          transform: [
            {
              type: aggregate
              fields: ["metricValue", "metricValue", "metricValue", "metricValue", "metricValue", "metricValue"]
              ops: ["min", "q1", "median", "q3", "max", "average"]
              as: ["min", "q1", "median", "q3", "max", "average"]
            }
          ]
        }
      ]
      marks: [
        {
          type: rect
          from: {data: "summary"}
          encode: {
            enter: {
              fill: {value: "black"}
              height: {value: 1}
            }
            update: {
              x: {scale: "xscale", field: "min"}
              x2: {scale: "xscale", field: "max"}
              zindex: 1
            }
          }
        }
        {
          type: rect
          from: {data: "summary"}
          encode: {
            enter: {
              stroke: {value: "black"}
              fill: {value: "white"}
            }
            update: {
              height: {value: 20}
              yc: {offset: -0.5}
              x: {scale: "xscale", field: "q1"}
              x2: {scale: "xscale", field: "q3"}
            }
          }
        }
        {
          type: rect
          from: {data: "summary"}
          encode: {
            enter: {
              fill: {value: "black"}
              width: {value: 1}
            }
            update: {
              height: {value: 20}
              yc: {offset: -0.5}
              x: {scale: "xscale", field: "median"}
            }
          }
        }
        {
          type: rect
          from: {data: "summary"}
          encode: {
            enter: {
              fill: {value: "red"}
              width: {value: 1}
            }
            update: {
              height: {value: 20}
              yc: {offset: -0.5}
              x: {scale: "xscale", field: "average"}
            }
          }
        }
      ]
    }
  ]
}"}}

